// ServiceBentoGrid.jsx

import React from "react";
import "./ServiceBentoGrid.css";
import { Search, Server, Globe, Bot, ShieldCheck, LucideIcon } from "lucide-react";

const services = [
  {
    icon: <Search size={20} color="#4dff29" />,
    title: "AI Search",
    description: "Intelligent and context-aware search that understands user intent."
  },
  {
    icon: <Server size={20} color="#4dff29" />,
    title: "Fast Backend",
    description: "High-speed backend infrastructure with caching and optimization."
  },
  {
    icon: <Globe size={20} color="#4dff29" />,
    title: "Web Integration",
    description: "Easily integrates with websites via clean APIs and embed options."
  },
  {
    icon: <Bot size={20} color="#4dff29" />,
    title: "Chatbots",
    description: "Deploy intelligent agents to answer questions and engage users."
  },
  {
    icon: <ShieldCheck size={20} color="#4dff29" />,
    title: "Security",
    description: "Top-tier data encryption and user privacy compliance features."
  }
];

const ServiceBentoGrid = () => {
  return (
    <div className="dashboard-wrapper">
      <div className="dashboard">
        {services.map((service, idx) => (
          <div className="bento-card" key={idx}>
            <h2>
              <span className="icon-container">{service.icon}</span>
              {service.title}
            </h2>
            <p>{service.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ServiceBentoGrid;
